import "./App.css";
import { Link } from "react-router-dom";
import Img from "./asset/img.png";
import styled from "styled-components";
import Img2 from "./asset/img2.png";
import React, { useState, useEffect } from "react";
import Loading from "./components/Loading";
import bg from "./asset/bg4.jpg";
const AppContainer = styled.div`
  background-image: url(${bg});
  background-size: cover;
  // background: "rgba(0, 0, 0, 0.9)";
`;
const Header = () => (
  <header className="App-header">
    <div className="container">
      <div className="header-content">
        <img
          style={{ borderRadius: "50%", border: "2px solid #3498db" }}
          src={Img}
          alt="No Due Management System Logo"
          width="150px"
          height="150px"
        />
        <div className="header-text">
          <MarqueeText>
            {/* eslint-disable-next-line jsx-a11y/no-distracting-elements */}
            <marquee>Welcome to No Due Management System(NDM).</marquee>
          </MarqueeText>
          <h1>No Due Management System</h1>
          <p>
            Efficiently manage and track dues with our user-friendly system.
          </p>
        </div>
      </div>
    </div>
  </header>
);

const Features = () => (
  <section id="features" className="App-section">
    <div className="container">
      <div className="feature-content">
        <div className="feature-text">
          <h2>Key Features</h2>
          <ul>
            <li>Track dues and deadlines</li>
            <li>User-friendly interface</li>
            <li>Secure and reliable</li>
            <li>Easy integration</li>
          </ul>
        </div>
        <div className="feature-image">
          <img
            src={Img2}
            alt="No Due Management System Logo"
            width="200px"
            height="200px"
          />
        </div>
      </div>
    </div>
  </section>
);

const CTA = () => (
  <section id="cta" className="App-section App-cta">
    <div className="container">
      <h2>Get Started Today</h2>
      <Link to="/login" className="login-btn">
        &#9755; Log In
      </Link>
    </div>
  </section>
);

const Footer = () => (
  <footer className="App-footer">
    <div className="container">
      <p>&copy; 2024 NDM by BMK</p>
    </div>
  </footer>
);

function App() {
  const [loading, setLoading] = useState(true);
  useEffect(() => {
    const fetchData = async () => {
      try {
        await new Promise((resolve) => setTimeout(resolve, 2000));
      } finally {
        setLoading(false);
      }
    };
    fetchData();
  }, []);

  return (
    <div className="App">
      <AppContainer>
        {loading ? (
          <Loading />
        ) : (
          <>
            <Header />
            <Features />
            <CTA />
            <Footer />
          </>
        )}
      </AppContainer>
    </div>
  );
}

export default App;
const MarqueeText = styled.div`
  margin-top: 1em;
  width: 100%;
  overflow: hidden;
`;
